import React from 'react';

// Base64 encoded webp image of the teacher avatar
const AVATAR_BASE64 = "data:image/webp;base64,-";

interface SirEduAvatarProps {
    isSpeaking?: boolean;
}

const SirEduAvatar: React.FC<SirEduAvatarProps> = ({ isSpeaking }) => {
    return (
        <div className={`relative w-48 h-auto transition-all duration-300 drop-shadow-lg ${isSpeaking ? 'scale-105' : 'scale-100'}`}>
            <img src={AVATAR_BASE64} alt="Sir.Edu Avatar" className="w-full h-full object-contain" />
            {isSpeaking && (
                <div className="absolute -bottom-4 inset-x-0 h-16 bg-blue-500/30 rounded-full blur-2xl animate-pulse"></div>
            )}
        </div>
    );
};

export default SirEduAvatar;
